※メーカーによって規格（画面サイズ）が異なりますので、製品のサイズをご確認の上ご注文下さい。<br><br><FONT color="#ff0000">【 世界初 】　もちろん 業界初！！<BR>
ナビ液晶用保護 強化ガラスフィルムが新登場。</FONT><BR>
<BR>
カーナビの液晶画面を強化ガラスで徹底ガード<BR>
装着もお手入れも超簡単で、触り心地も抜群！<BR>
<BR>
カーナビの液晶画面は、指で直接触れるため、皮脂などの汚れが付着しやすく、強い衝撃を与えてしまう可能性が高い。<BR>
また、タッチパネル操作をした時に、液晶画面特有のザラザラした触り心地が何となく気になりますが、この「ナビゲーションガード」は、カーナビの液晶画面専用に開発された保護用強化ガラスで、スマートフォンなどの樹脂製液晶保護シートと同じような感じに画面に貼り付けることで、カーナビの液晶画面を強力にプロテクトする製品です。<BR>
<BR>
0.33mm厚の特殊な強化ガラス製なので、樹脂製保護シートと比較しキズが入りにくいだけでなく、汚れが付きにくい。<BR>
また、仮に皮脂などで汚れてしまったとしても、適当な布で軽く拭き取るだけで簡単に綺麗な状態に戻る点はガラスならではのメリット。<BR>
<BR>
さらに装着後は、滑らかなガラス面を指先で操作するようになるので、一般的な液晶画面ではあり得ないほど触り心地のいい状態になることも特徴のひとつ。<BR>
もちろん、硬度の高い強化ガラスで画面を保護するので、液晶画面の損傷を防げます。<BR>
<BR>
そしてもうひとつ！！<BR>
<BR>
液晶画面をクリーニングする専用クロスやクリーナー、装着作業に重宝するミニ吸盤、ヘラなども付属しており、樹脂製保護シートの装着よりも圧倒的に気泡が入りにくく、とにかく作業が超簡単です♪<BR>
<BR>
7インチ/8インチ/9インチ/10インチ をご用意致しました。
<BR>
<BR>
【ナビガードサイズ】<BR>
７インチ◎155mm×81mm<BR>
８インチ◎174mm×103.5mm<BR>
９インチ◎198mm×112mm<BR>
10インチ◎223mm×126mm<BR><BR>

【セット内容】<BR>
 強化ガラスフィルム　1枚<BR>クロス１枚<BR>クリーナー　1枚<BR>
<BR>


